import React from "react";

class App extends React.Component{
    constructor(props){
        super(props)
        this.state={
            exText: "example",
            userData: ""
        }
    }

        handleChange(event){
            this.setState({userData: event.target.value})
        }

        handleSubmit(event){
            alert("Your data: "+this.state.userData)
            event.preventDefault()
        }
    
    render(){
        return(
            <div>
                <form onSubmit={this.handleSubmit}>
                <h1>WRITE YOUR DATA</h1>
                <input type="text" placeholder={this.state.exText} value={this.state.userData} onChange={this.handleSubmit} ></input>
                <input type="submit" value="send"></input>
                </form>
            </div>
        )
    }
}
